package com.Util;

import java.text.SimpleDateFormat;
import java.time.LocalDate;
import java.time.LocalDateTime;
import java.time.LocalTime;
import java.time.format.DateTimeFormatter;
import java.util.Date;

public class CommonUtil 
{
	public static Long GMT=19800000L;
	//public static Long GMT=0L;
	public static String icon1=""; 
	public static String icon2="";
	public static String delivery="";
	public static String blacklist="";
	public static String meeting="";
	
	public static String dateFormat(Date date)
	{
		if(date!=null)
		{
			SimpleDateFormat format=new SimpleDateFormat("hh:mm:ss a");
			return format.format(date);
		}
		else
			return null;
	}
	
	public static String dateFormat(Date date,Integer id)
	{
		if(date!=null)
		{
			SimpleDateFormat format=new SimpleDateFormat("dd MMM, yyyy hh:mm:ss a");
			return format.format(date);
		}
		else
			return null;
	}
	
	
	
	public static Date dateFormat(String time)
	{
			try 
			{
				LocalDateTime localDateTime=LocalDateTime.of(java.time.LocalDate.now(),LocalTime.parse(time, DateTimeFormatter.ofPattern("HH:mm:ss")) );
				return java.sql.Timestamp.valueOf(localDateTime);
			}
			catch (Exception e) 
			{
				return null;
			}
			
	}

	public static Date dateFormat(String date, String time) 
	{
		try 
		{
			LocalDateTime localDateTime=LocalDateTime.of(LocalDate.parse(date, DateTimeFormatter.ofPattern("MMM dd, yyyy")),LocalTime.parse(time, DateTimeFormatter.ofPattern("HH:mm:ss")) );
			return java.sql.Timestamp.valueOf(localDateTime);
		}
		catch (Exception e) 
		{
			return null;
		}
	}
}
